    //const insets = useSafeAreaInsets();
    return (
        <View
            style={styles.container}
        
        >
            <Text>Estamos en web</Text>
            <Button
                title="prueba"
                onPress={()=> navigation.navigate(
                    'Profile', 
                    { name: 'Jane', }
